import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./styles.css";
import ModelEvaluationPage from "./ModelEvaluationPage";

function HomePage() {
  return <div className="page-container">Welcome to my project</div>;
}

function VisualizationPage() {
  return <div className="page-container">This is my plots</div>;
}

function App() {
  return (
    <Router>
      <div className="app-container">
        <nav className="nav-bar">
          <Link to="/" className="nav-link">Home</Link>
          <Link to="/visualisation" className="nav-link">Visualisation</Link>
          <Link to="/model-evaluation" className="nav-link">Model Evaluation</Link>
        </nav>
        <div className="content-container">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/visualisation" element={<VisualizationPage />} />
            <Route path="/model-evaluation" element={<ModelEvaluationPage />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
